import styled from "styled-components"

export const Title = styled.h1`
    font-family: 'Poppins';
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    position: absolute;
`;

export const Header = styled.div`
    background: red;
    height: 64px;
    align-items: center;
    justify-content: center;
    display: flex;
`;

export const Container = styled.div`
    background: #FFFFFF;
`;

export const HeaderButtonLeft = styled.button`
    margin-left: 10px;
    left: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;

export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;

export const TextContainer2 = styled.text`
    position: relative;
    left: 6.35%;
    right: 63.81%;
    top: 31.58%;
    bottom: 31.58%;
`;
export const Container2 = styled.view`
    position: relative;
    height: 57px;
    width: 50px;
    left: 16px;
    top: 16px;
    box-shadow: 0px 10px 22px rgba(149, 173, 254, 0.3);
    border-radius: 16px;
    background: #EAF8F7;
`;
